      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col0 ) / - col2 BETWEEN CAST ( + 10 AS INTEGER ) AND + ( - col0 ) * + col0 - + 24;
  - name: tab1

outputs:
